import React from 'react';
import '../../stylesheets/footer/footer.css';
import footerPhoto from '../../assets/photo-footer.svg';
import returnArrow from '../../assets/back-to-top.svg';

function Footer() {
  return (
    <footer>
      <article>
        <img src={footerPhoto} alt="Profil CV" className="footer-photo" />
        <h3 className="footer-title">À bientôt dans vos équipes !</h3>
        <p className="footer-paragraph1">Si vous êtes arrivé jusqu&#39;ici, c&#39;est que mon profil vous intéresse.</p>
        <p className="footer-paragraph2">Alors n&#39;hésitez plus, contactez-moi pour me recruter dès maintenant !</p>
      </article>
      <img src={returnArrow} alt="Retourner en haut de la page" className="back-to-top" />
    </footer>
  );
}

export default Footer;
